import React, { Component } from 'react';

class MenuFullOprion extends Component {

	PhanQUen = () => {
		console.log(this.props.Phanquen.length)

	}

	render() { 
		return (
			<ul className="sidebar navbar-nav">
					<li className="nav-item active">
							{this.PhanQUen()}	
					</li>
			</ul>
		);
	}
}

export default MenuFullOprion;
